import './ExpenseStyle.css';

const Expense=(props)=>{
    return (
        <div className="expense">
            <div className="expense-date">
                <p>Month</p>
                <p>Day</p>
                <p>Date</p>
            </div>
            <div className="expense-title">
                Bought Books
            </div>
            <div className="expense-amount">
                $19
            </div>
        </div>
    );
}

export default Expense;
